import React, { useState } from 'react';
import { registerUser } from '../utils/database';
import { IonButton, IonInput, IonSelect, IonSelectOption, IonAlert } from '@ionic/react';
import '@ionic/react/css/core.css';

const AuthRegisterForm = ({ onRegisterSuccess, switchToLogin }) => {
  const [form, setForm] = useState({
    nombre: '',
    email: '',
    password: '',
    rol: 'cuidador'
  });
  const [loading, setLoading] = useState(false);
  const [showSuccess, setShowSuccess] = useState(false);
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      if (!form.nombre || !form.email || !form.password) {
        throw new Error('Todos los campos son obligatorios');
      }

      await registerUser(form);
      setShowSuccess(true);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-white rounded-lg shadow-md">
      <h2 className="text-2xl font-bold text-center mb-6">Registro de Usuario</h2>

      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block text-gray-700 mb-2">Nombre Completo *</label>
          <input
            type="text"
            value={form.nombre}
            onChange={(e) => setForm({...form, nombre: e.target.value})}
            className="w-full p-2 border rounded focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div>
          <label className="block text-gray-700 mb-2">Email *</label>
          <input
            type="email"
            value={form.email}
            onChange={(e) => setForm({...form, email: e.target.value})}
            className="w-full p-2 border rounded focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div>
          <label className="block text-gray-700 mb-2">Contraseña * (mínimo 6 caracteres)</label>
          <input
            type="password"
            value={form.password}
            onChange={(e) => setForm({...form, password: e.target.value})}
            className="w-full p-2 border rounded focus:ring-2 focus:ring-blue-500"
            minLength="6"
            required
          />
        </div>

        <div>
          <label className="block text-gray-700 mb-2">Rol *</label>
          <select
            value={form.rol}
            onChange={(e) => setForm({...form, rol: e.target.value})}
            className="w-full p-2 border rounded focus:ring-2 focus:ring-blue-500"
            required
          >
            <option value="cuidador">Cuidador</option>
            <option value="doctor">Doctor</option>
            <option value="administracion">Administración</option>
          </select>
        </div>

        {error && (
          <div className="text-red-500 text-sm p-2 bg-red-50 rounded">
            {error}
          </div>
        )}

        <button
          type="submit"
          disabled={loading}
          className={`w-full bg-green-500 text-white py-2 px-4 rounded-lg hover:bg-green-600 transition ${
            loading ? 'opacity-50 cursor-not-allowed' : ''
          }`}
        >
          {loading ? 'Registrando...' : 'Registrarse'}
        </button>

        <div className="text-center mt-4">
          <button
            type="button"
            onClick={switchToLogin}
            className="text-blue-500 hover:underline"
          >
            ¿Ya tienes cuenta? Inicia sesión
          </button>
        </div>
      </form>

      {/* Alert de éxito */}
      <IonAlert
        isOpen={showSuccess}
        onDidDismiss={() => {
          setShowSuccess(false);
          onRegisterSuccess();
        }}
        header="Registro Exitoso"
        message="¡Tu cuenta ha sido creada correctamente! Serás redirigido al login."
        buttons={['OK']}
      />
    </div>
  );
};

export default AuthRegisterForm;
